import React, { Component } from 'react'
import { Route, Routes } from 'react-router-dom'

export default class Blogs extends Component {
  render() {
    return (
      <div>
        <Routes>
        <Route path="/" render={()=><h1>Home</h1>} exact></Route>
        <Route path="/course" render={()=><h1>Course</h1>} exact></Route>
        <Route path="/pricing" render={()=><h1>Price</h1>} exact></Route>
        <Route path="/disabled" render={()=><h1>Disabled</h1>} exact></Route>
        </Routes>
      </div>
    )
  }
}
